import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Button, Container, Form, FormGroup, Label, Input, Row, Col } from 'reactstrap';
import './App.css';
import './Business.css';

class BusinessCard extends Component {
    constructor(props) {
      super(props);
    }

    render() {
        return (
            <li key={this.props.business.id} class="BusinessCard">
              <Container className="businessInfoContainer">
                <Row>
                  <Col sm={2} className="businessPic">
                    <p>placehodler for pic</p>
                  </Col>
                  <Col sm={10}className="businessInfo">
                    <p>Business Card element for: {this.props.business.name}</p>
                  </Col>
                </Row>
              </Container>
            </li>
        );
    }

}

export default BusinessCard;
